import './Table.css';
import Song from './Song.js';
import { useState } from 'react';

function TableNavBar() {

return (
  <div className='table'>
    <link rel="stylesheet" href="https://use.typekit.net/lll4eml.css"></link>
    <div className='tableNavBar'>
      <div className='tableNavBarItem'>Songs</div>
      <div className='tableNavBarItem'>Artists</div>
    </div>
    <div className='tableNavBar'>
      <div className='tableNavBarItem'>Past Month</div>
      <div className='tableNavBarItem'>Past 6 Months</div>
      <div className='tableNavBarItem'>All Time</div>
    </div>
  </div>
);
}

export default TableNavBar;
